import { createGlobalStyle } from "styled-components";

export default createGlobalStyle`
  :root {
    --background: #0F0F0F;
    --primaryText: #FFF;
    --secondaryText: #CCC;
    --primaryColor: #FFC1A9;
    --dribbbleColor: #FAC;
    --twitterColor: #6CF;
    }
`;
